import React from 'react'

export default function ListItem({item}) {
    return (
        <div>
            {
                item.description !== "" ? (
                    <p>{item.timeStamp + " " + item.user}</p>
                ) : (
                    <p>{item.user}</p>
                )
            }
        </div>
    )
}
